import React, { Component } from 'react';
import './style.css';
import {Helmet} from 'react-helmet'

class Episode1 extends React.Component {
  render() { 
    return (
      <React.Fragment>
        <div className="container">
          <div className="health">
            <span id="amount">1000</span>
            <span id="hunger"></span>
            <span id="thirst">10</span>
            <span id="stamina">10</span>
          </div>
          <div id="text">Text</div>
          <div id="option-buttons" className="btn-grid">
            <button className="btn">Option 1</button>
            <button className="btn">Option 2</button>
            <button className="btn">Option 3</button>
            <button className="btn">Option 4</button>
          </div>
        </div>
        <script defer src="./../src/game.js"></script>
      </React.Fragment>
    )
  }
}

export default Episode1;
